text:
Deepfakes have the potential to cause harm to individuals and their image. I am proud of Brooke for sharing her story and for bringing attention to this issue.

@HouseCommerce passed legislation out of Committee that will criminalize the publication of non-consensual, sexually exploitative images—including AI-generated deepfakes—and require platforms to remove images within 48 hours of notice.

